import React from 'react'

function Publish(treatments) {
  return (
    <div>
        {loading ? (<h1>loading...</h1>) : error ? (<h1>Error</h1>) : (treatments.map(treatments=>{
        return <h1>{treatments.name}</h1>
      }))}
    </div>
  )
}

export default Publish
